import {Link, Outlet} from "react-router-dom"
const Navbar=()=> {
    
        return (
            
                // <div className="">
                    
                    <div style={{width:"10vw"}} >
                       
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/business">Business</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/entertainment">Entertainment</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/general">General</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/health">Health</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/science">Science</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/sports">Sports</Link></div>
                            <div className='my-3 mx-2'><Link className="nav-link" to="/Reading/News/technology">Technology</Link></div>
                            <Outlet/>
                        
                    </div>
                // </div>
            
        )
    
}
export default Navbar;
